	public ByteArrayInputStream createPdf(Map<String, Object> payloadMap, Map<String, Object> prevMap) {
		ByteArrayOutputStream baos = new ByteArrayOutputStream();
		try {
			PdfWriter writer = new PdfWriter(baos);
			PdfDocument pdf = new PdfDocument(writer);
			writePdf(pdf, payloadMap, prevMap);
			System.out.println("PDF generated successfully");
		} catch (Exception ex) {
			ex.printStackTrace();
		}
		return new ByteArrayInputStream(baos.toByteArray());
	}

	private void writePdf(PdfDocument pdf, Map<String, Object> payloadMap, Map<String, Object> prevMap) {
		Document doc = new Document(pdf);
		for (String key : prevMap.keySet()) {
			String value = String.valueOf(prevMap.get(key));
			String nValue = String.valueOf(payloadMap.get(key));
			doc.add(getParagraph(key, nValue, value));
		}
		doc.close();
	}

	private Paragraph getParagraph(String key, String value, String prevValue) {
		Paragraph paragraph = new Paragraph();
		paragraph.add(getText(StringUtils.join(key, " : "), Color.BLACK, false));
		if (StringUtils.equals(value, prevValue)) {
			paragraph.add(getText(value, Color.BLACK, false));
			return paragraph;
		}
		paragraph.add(getText(prevValue, Color.RED, true));
		paragraph.add(getText(value, Color.GREEN, false));
		return paragraph;
	}

	private Text getText(String value, Color color, boolean lineThrough) {
		Text text = new Text(value);
		text.setFont(getFont());
		text.setFontColor(color);
		if (lineThrough) {
			text.setLineThrough();
		}
		return text;
	}

	private PdfFont getFont() {
		try {
			return PdfFontFactory.createFont(FontConstants.HELVETICA);
		} catch (IOException ex) {
			ex.printStackTrace();
			return null;
		}
	}
